def get_score(output,tier1,tier2,mul):
    score=0
    skills_score,college_score,company_score=0,0,0
    skills_valuation={'data visualisation':40,'machine learning':90,'bigdata/cloudcomputing':30,'programming languages':30,'statistics':50,'software development':40,'SQL/databases':30,'deep learning':90,'other':0}
    skills=output['skills']
    for k,v in skills.items():
        temp=len(v)
        skills_score+=skills_valuation[k] if temp > skills_valuation[k] else temp    
    score+=skills_score
    college_valuation={'tier1':tier1,"tier2":tier2,"tier3":0}    
    colleges=output['universities']
    for k,v in colleges.items():
        college_score+=college_valuation[k]*len(v)
    college_score=(college_score+5) if college_score==0 else college_score 
    score+=college_score

    companies=output['experience per company']
    other_experience=0
    good_experience=0
    for key,value in companies.items():
        if key=='other':
            other_experience+=value
        else:
            good_experience+=value
    company_score=good_experience*mul+other_experience        
    score+=company_score
    #print(company_score)
    return skills_score,college_score,company_score,score
